import { Icon } from '@iconify/react'
import wildfire from '@iconify/icons-mdi/fire-alert'

const LocationMarker = ({ isVolcano, lat, lng, onClick }) => {
    let marker;
    if (isVolcano) {
        marker = <Icon icon="emojione:volcano" className="location-icon" />
   } else { marker = <Icon icon={wildfire} className="location-icon" />}
    return (
        <div className="location-marker" onClick={onClick}>

        {marker}
        </div>
    )
}

export default LocationMarker
